//SPDX-License-Identifier: Unlicensed
pragma solidity ^0.8.0;

contract Challenge1 {

    event warriorCreated(string name, uint attack, uint defense);

    struct fakeWarrior {
        string name;
        uint attack;
        uint defense;
    }

    modifier isValidAttributes(uint attack, uint defense) {
        require(attack < 100 && defense < 1000, "Invalid attributes"); 
        _;
    }

    modifier onlyOwner() {
        require(msg.sender == owner, "not owner");
        _;
    }

    mapping(uint => fakeWarrior) warriors;
    mapping(uint => address) warriorOwner;
    mapping(address => bool) whitelisted;

    uint public tokenId;
    address public owner;

    constructor() {
        owner = msg.sender;
    }

    function createWarrior(string memory _name, uint _attack, uint _defense) public isValidAttributes(_attack, _defense) {
        require(whitelisted[msg.sender], "Only whitelisted users can create warriors");
        fakeWarrior memory warrior = fakeWarrior(_name, _attack, _defense);
        warriors[tokenId] = warrior;
        warriorOwner[tokenId] = msg.sender;
        tokenId++;
        emit warriorCreated(_name, _attack, _defense);
    }

    function whitelist(address _addr) public onlyOwner {
        whitelisted[_addr] = true;
    }

    function getWarrior(uint _id) public view returns (fakeWarrior memory warrior) {
        require(_id < tokenId, "Invalid warrior id");
        warrior = warriors[_id];
    }

    function getOwnerOfWarrior(uint _id) public view returns (address ownerOfWarrior) {
        require(_id < tokenId, "Invalid warrior id");
        ownerOfWarrior = warriorOwner[_id];
    }

}

